import styled from 'styled-components';

export const ModalButton = styled.div`
    dispaly: block;
    width: 80px;
    height: 40px;
    line-height: 40px;
    text-align: center;
    border-radius: 30px;
    background-color: black;
    margin: 0 auto;
    color: white;
`

export const ModalLayer = styled.div`
    width: 100px;
    height: 100px;
    display: block;
    position: absolute;
    background-color: gray;
    top: 0px;
    left: 50%;
    translateX: -50%
`
